        "Причина обращения: При приеме автомобиля клиент указал на неисправнось Driving Assistant и стук спереди справа.\nАвтомобиль принят грязный, что мешает осмотру по дефектам кузову. Салон автомобиля загрязнён. Трещина лобового стекла. Горит ошибка неисправности Driving Assistant\nБыла произведена С/У защиты, обнаружена погнутая пластина жесткости, произвели правку пластины (стук не обнаружен). При мойке радиатора было замечено повреждение сот Радиатора охлаждающей жидкости. Уровень антифриза в норме. Рекомендуется  проверка уровня утром после использования автомобиля.\nПо результату комп. Диагностики: отсутствие связи с радаром ACC. Произвели проверку проводки радара, произвели пропайку микросхемы радара (клиент предупрежден что работа без гарантии, возможен выход из строя радара)\nАвтомобиль после проведенных работ осмотрен, салон после проведенных работ убран, дефектов не выявлено. В системе автоматической диагностики неисправности отсутствуют. \n\n",
